CREATE DEFINER=`root`@`%` TRIGGER `member_created` BEFORE INSERT ON `member` FOR EACH ROW BEGIN
	IF NEW.created_at IS NULL THEN
		SET NEW.created_at = NOW();
	END IF;
END

